import React from 'react';

function ProfileHeader(props) {
  const { profile } = props;
  if (!profile.length) {
    return <h2>No profile found!</h2>;
  }
  return (
    <div>
      <h1>Profile Header</h1>
    </div>
  );
}

export default ProfileHeader;
